import './Navbar.css'
import {Link} from 'react-router-dom'
import {styled}from "styled-components";

const StyledLink = styled(Link)`
    color: Blue;
    text-decoration:none;
    margin: 1px;
    position: SpeechRecognitionAlternative;
    `;


const Navbar = () => {
    return(
       <div className="main-container">
            <nav class="navbar navbar-expand-sm navbar-light bg-transparent">
                <div class="collapse navbar-collapse" id ="navbarNav">
                    <a class="navbar-brand" href="index.html">
                        <img src={"assets/Mug_Mr_And_Mrs_Koi.jpg"} alt="" height = "100" />  </a>
                        <div className="links">
                            <StyledLink to="/">Home</StyledLink>
                            <StyledLink to="/blog">Blog</StyledLink>
                            <StyledLink to="/contact">Contact Us</StyledLink>

                        </div>
                    <a class="navbar-cart" href="checkout.html">

                        <img src={"https://www.freeiconspng.com/thumbs/cart-icon/basket-cart-icon-27.png"} alt="" height = "35" ></img>
                    </a>

                </div>

            </nav>
       </div>
    )
}

export default Navbar
